import React from 'react';

const Dashboard = ({photos, handlePhotoOnClick}) => {
  let noImagesDiv = <div className="no-photos"> no images yes, please upload some! </div>;
  return (
    <div className="dashboard-wrapper">
      {photos.length ?
        photos.map((image, idx) =>
          <div handlePhotoOnClick={handlePhotoOnClick} className={`imageContainer ${image.class}`}>
              <img className='photo' src={image.url} key={idx} />
          </div>):
        noImagesDiv }
    </div>
  )
}

export default Dashboard;
